import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Section from "./Section";
import PersonCard from "./PersonCard";


const App = () => {
    return (
        <div>
            <Header />
            <PersonCard name="John"
                        img="https://upload.wikimedia.org/wikipedia/commons/8/8a/Albobah.jpg"
                        tel="393 023 203"
                        email="j@johanes.com"
            />
            <PersonCard />
            <PersonCard />
            <Section/>
            <Section/>
            <Section/>
            <Section/>
            <Footer />
        </div>
    );
}

export default App;
